=head1 DESCRIPTION

Detailed information about an entry violation in a network ACL. The
violation is against the network ACL specification inside the Firewall
Manager network ACL policy. This data object is part of
C<InvalidNetworkAclEntriesViolation>.

=head1 ATTRIBUTES


=head2 ActualEvaluationOrder => Str

The evaluation location within the ordered list of entries where the
C<ExpectedEntry> is currently located.


=head2 EntriesWithConflicts => ArrayRef[L<Paws::FMS::EntryDescription>]

The list of entries that are in conflict with C<ExpectedEntry>.


=head2 EntryAtExpectedEvaluationOrder => L<Paws::FMS::EntryDescription>

The entry that's currently in the C<ExpectedEvaluationOrder> location,
in place of the expected entry.


=head2 EntryViolationReasons => ArrayRef[Str|Undef]

Descriptions of the violations that Firewall Manager found for these
entries.


=head2 ExpectedEntry => L<Paws::FMS::EntryDescription>

The Firewall Manager-managed network ACL entry that is involved in the
entry violation.


=head2 ExpectedEvaluationOrder => Str

The evaluation location within the ordered list of entries where the
C<ExpectedEntry> should be, according to the network ACL policy
specifications.



